import Layout from '../../../components/layout';
export default function Comment() {
    return (
        <Layout>
            <div className="container">
                <div class="custom-file">
                    <input
                        type="file"
                        class="file-control-file"
                        id="customFile"
                    />
                    <label class="custom-file-label" for="customFile">
                        Choose file
                    </label>
                </div>
            </div>
        </Layout>
    );
}
